
SELECT MIN("member"."region_no") as agg_0 FROM "provider" LEFT OUTER JOIN "region" ON "provider"."region_no" = "region"."region_no" LEFT OUTER JOIN "member" ON "region"."region_no" = "member"."region_no" LEFT OUTER JOIN "corporation" ON "region"."region_no" = "corporation"."region_no" LEFT OUTER JOIN "charge" ON "member"."member_no" = "charge"."member_no" LEFT OUTER JOIN "payment" ON "member"."member_no" = "payment"."member_no"  WHERE "region"."street" IN ('555 Fifth St St', '888 Eighth St.', '666 Sixth') AND "provider"."expr_dt" NOT LIKE '%10:41:21%' AND "region"."country" != '%Sw%' AND "corporation"."region_no" IS NOT NULL AND "charge"."member_no" IS NOT NULL AND "payment"."member_no" IS NOT NULL;